PREFIX brick: <https://brickschema.org/schema/Brick#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?point ?label WHERE {
  ?point a ?type .
  FILTER(CONTAINS(LCASE(STR(?type)), "point"))
  OPTIONAL { ?point rdfs:label ?label }
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX ex: <http://example.org/>

SELECT ?point ?type WHERE {
  ?point a ex:Point .
  ?point rdf:type ?type .
}

PREFIX m: <http://example.org/ontology#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pointLabel ?categoryLabel WHERE {
  ?point a m:MeasurementPoint .
  ?point rdfs:label ?pointLabel .
  OPTIONAL {
    ?point m:hasCategory ?category .
    ?category rdfs:label ?categoryLabel .
  }
}

PREFIX brick: <https://brickschema.org/schema/Brick#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?dataPointClass ?categoryClass WHERE {
  # Find all classes that represent a data point (subclass of Brick:Point or Brick:Tag)
  ?dataPointClass rdfs:subClassOf* brick:Point .
  OPTIONAL {
    # The immediate parent (category) classification, excluding the generic Brick:Point
    ?dataPointClass rdfs:subClassOf ?categoryClass .
    FILTER(?categoryClass != brick:Point)
  }
}
ORDER BY ?dataPointClass
LIMIT 200
